import kevin from "../assets/users/kevin.jpg";

export default class Passengers extends Component {
  render() {
    return (
      <div>
        <div className="pass__each">
          <h2 className="pass__name">Kevin Tang</h2>
          <div className="pass__info">
            <p>Rides: 12</p>
            <p>Amount: $48.50</p>
          </div>
        </div>
      </div>
    );
  }
}
